/* SYNTAX VARIABLES */
/* COLOR PALETTE */
/*
  OPEN COLOR 1.6.2
  by yeun
  github.com/yeun/open-color
*/
.github-BranchMenuView .hidden {
  display: none;
}
.github-BranchMenuView-selector {
  display: flex;
  align-items: center;
}
.github-BranchMenuView-item {
  margin: 6px;
}
.github-BranchMenuView .icon-sync::before {
  animation: github-BranchViewSync-animation 2s linear 30;
}
@keyframes github-BranchViewSync-animation {
  100% {
    transform: rotate(360deg);
  }
}
.github-BranchMenuView .icon-git-branch {
  flex-basis: 16px;
  flex-grow: 0;
  flex-shrink: 0;
  color: #626274;
}
.github-BranchMenuView .icon-git-branch::before {
  margin-right: 0;
  text-align: center;
}
.github-BranchMenuView-select {
  flex-grow: 1;
  flex-shrink: 1;
  width: 100%;
}
.github-BranchMenuView-button {
  flex-grow: 0;
  flex-shrink: 0;
}
.github-BranchMenuView-editor {
  flex: 1;
}
.github-BranchMenuView-editor atom-text-editor,
.github-BranchMenuView-editor atom-text-editor .cursor-line {
  background-color: inherit;
}
.github-BranchMenuView-editor atom-text-editor[mini] {
  font-size: inherit;
  text-align: left;
}
.github-BranchMenuView-editor atom-text-editor[readonly] {
  color: #626274;
  pointer-events: none;
}
.github-BranchMenuView-message {
  max-height: 20em;
  margin: 6px;
  padding: 6px;
  line-height: 1.4;
  white-space: normal;
  text-align: left;
  overflow-y: auto;
  border: 1px solid #363659;
  border-radius: 4px;
  background-color: #363659;
}
.github-BranchMenuView-message:empty {
  display: none;
}
